import React from 'react';
import Header from 'Vendedor/header';
import Ejemplo from './Vendedor/ejemplo';
function Nav(){
    return(
        
    <BrowserRouter>
        <Header/>
        <Routes>
        <Route path="/ejemplo" element={<Ejemplo />} /> {/* Ruta para el formulario de registro */}
        </Routes>
    </BrowserRouter>
    
    );
}

export default Nav;
